import React from "react";
import LoggedinNavbar from "../navigation/nav";

const FriendPage = () => {
    return (
        <div>
            <LoggedinNavbar />
            <div>
                You have been assigned Alan as your study friend!
                You can chat with him here
            </div>
        </div>

    )
}

export default FriendPage
